open Graphics

type fire = First | Second | Third | Fourth | Fifth | Sixth | Seventh | Eighth | Nineth
type direction = VeryVeryLeft | VeryLeft | Left | Center | Right | VeryRight | VeryVeryRight | Cos | Sin | CosLeft | CosRight | SinLeft | SinRight
type bonus_type = Weapon | Life | Frequence

class base_item (x : int) (y : int) (height : int) (width :int) (right : int) (up : int) (lives : int) (color : color) =
	object (self)
		val mutable x = x
		val mutable y = y
		val h = height
		val w = width
		val r = right
		val u = up
		val mutable l = lives
		val c = color
		method x = x
		method y = y
		method h = h
		method w = w
		method is_bonus = false
		method decrement_life x = l <- l - x
		method private is_hitted x2 y2 w2 h2 = if x + w > x2 && x < x2 + w2 && y + h > y2 && y < y2 + w2 then true else false
		method out_of_bounce = if y < 0 || y + h > u then true else false
		method collision (other : base_item) = match (self#is_hitted other#x other#y other#w other#h) with 
												true -> other#decrement_life 1; self#decrement_life 1
												|_ -> other#decrement_life 0; self#decrement_life 0
		method collison_bonus (other : base_item) = match (self#is_hitted other#x other#y other#w other#h) with
													true -> other#decrement_life 1; true
													|_ -> false
		method draw = set_color c; fill_rect x y w h
		method move_base xd yd = x <- x + xd; y <- y + yd
		method is_alive = l > 0
		method move = ()
		method b = First
		method bt = Weapon
	end

class bonus (x : int) (y : int) (height : int) (width :int) (right : int) (up : int) (lives : int) (color : color) (bonus_type : bonus_type) =
	object (self)
		inherit base_item x y height width right up lives color as super
		val bt = bonus_type
		method bt = bt
		method is_bonus = true
		method move = super#move_base 0 (-10)
	end

class bonus_list (bonus : bonus list) (right : int) (up : int) =
	object (self)
		val mutable b = bonus
		val r = right
		val u = up
		method private add (bonus : bonus) = b <- bonus::b
		method private random_bonus_type = let x = Random.int 4 in match x with
										0 | 1 -> Weapon
										|2 -> Life
										|_ -> Frequence
		method private random_bonus = new bonus (Random.int r) (u-15) 10 10 r u 1 green self#random_bonus_type
		method get = b
		method spawn_bonus = let rand = Random.int 250 in
										match rand with
										5 -> self#add self#random_bonus
										|_ -> ()
		method move = List.iter (fun x -> x#move) b
		method draw = List.iter (fun x -> x#draw) b
		method filter_exploded = b <- List.filter (fun x -> x#is_alive) b
		method filter_out = b <- List.filter (fun x -> not x#out_of_bounce) b
	end

class ship (x : int) (y : int) (height : int) (width :int) (right : int) (up : int) (lives : int) (color : color) (bonus : fire) (frequence : int list) =
	object (self)
		inherit base_item x y height width right up lives color as super
		val mutable b = bonus
		val mutable f = frequence
		method b = b
		method f = f
		method private get_x = let (x,_) = mouse_pos () in x
		method private upgrade_bonus = match b with
										First -> b <- Second
										|Second -> b <- Third
										|Third -> b <- Fourth
										|Fourth -> b <- Fifth
										|Fifth -> b <- Sixth
										|Sixth -> b <- Seventh
										|Seventh -> b <- Eighth
										|Eighth -> b <- Nineth
										|Nineth -> b <- Nineth
		method private upgrade_freq = match f with
									[10] -> f <- [5;10]
									|[5;10] -> f <- [3;7;10]
									|[3;7;10] -> f <- [0;3;6;9]
									|_ -> f <- [0;3;6;9]
		method move = x <- self#get_x
		method draw_live = moveto (r / 4) 10; set_color red; draw_string (string_of_int l)
		method private bonus_upgrade (other :base_item) = match other#bt with
														Weapon -> self#upgrade_bonus
														|Life -> self#decrement_life (-1)
														|Frequence -> self#upgrade_freq
		method private collision (other : base_item) = if other#is_bonus then match self#collison_bonus other with
																				true -> self#bonus_upgrade other
																				|_ -> ()
														else super#collision other
		method collision_list (others : base_item list) = List.iter (fun x -> self#collision x) others
	end

class ball (x : int) (y : int) (height : int) (width :int) (right : int) (up : int) (lives : int) (color : color) (direction : direction) (to_up : bool) =
	object (self)
		inherit base_item x y height width right up lives color as super
		val d = direction
		val tu = to_up
		method private sin_int j = int_of_float (sin (float_of_int ((y + j) / 15)) *. 30.)
		method private cos_int j = int_of_float (cos (float_of_int ((y + j) / 15)) *. 30.)
		method move = if tu then match d with
								VeryVeryLeft -> super#move_base (-3) 7
								|VeryLeft -> super#move_base (-2) 8
								|Left -> super#move_base (-1) 9
								|Center -> super#move_base 0 10
								|Right -> super#move_base 1 9
								|VeryRight -> super#move_base 2 8
								|VeryVeryRight -> super#move_base 3 7
								|Cos -> super#move_base (self#cos_int 10) 10
								|Sin -> super#move_base (self#sin_int 10) 10
								|SinLeft -> super#move_base ((self#sin_int 9) - 1) 9
								|SinRight -> super#move_base (1 + (self#sin_int 9)) 9
								|CosLeft -> super#move_base ((self#cos_int 9) - 1) 9
								|CosRight -> super#move_base (1 + (self#cos_int 9)) 9
							else match d with
								VeryVeryLeft -> super#move_base (-3) (-7)
								|VeryLeft -> super#move_base (-2) (-8)
								|Left -> super#move_base (-1) (-9)
								|Center -> super#move_base 0 (-10)
								|Right -> super#move_base 1 (-9)
								|VeryRight -> super#move_base 2 (-8)
								|VeryVeryRight -> super#move_base 3 (-7)
								|Cos -> super#move_base (self#cos_int (-10)) (-10)
								|Sin -> super#move_base (self#sin_int (-10)) (-10)
								|SinLeft -> super#move_base ((self#sin_int (-9)) - 1) (-9)
								|SinRight -> super#move_base (1 + (self#sin_int (-9))) (-9)
								|CosLeft -> super#move_base ((self#cos_int (-9)) - 1) (-9)
								|CosRight -> super#move_base (1 + (self#cos_int (-9))) (-9)
	end

class block (x : int) (y : int) (height : int) (width :int) (right : int) (up : int) (lives : int) (color : color) =
	object (self)
		inherit base_item x y height width right up lives color as super
		method move = super#move_base 0 (-10)
	end

class boss (x : int) (y : int) (height : int) (width :int) (right : int) (up : int) (lives : int) (color : color) (image : image) (bonus : fire) =
	object (self)
		inherit base_item x y height width right up lives color as super
		val i = image
		val b = bonus
		val max_lives = lives
		method b = b
		method draw = draw_image i x y
		method draw_lives = set_color blue; moveto (r * 3 / 4) 10; draw_string (string_of_int l); draw_string " / "; draw_string (string_of_int max_lives)
		method move = let ran = Random.int 20 in
					let x1 = r / 2 in
					let y1 = u * 3 / 4 in
					match ran with
					10 -> super#move_base ((x1 - x) / 10) ((y1 - y) / 10)
					|_ -> super#move_base (Random.int 20 - 10) (Random.int 20 - 10)
		method collision_balls (balls : base_item list) = List.fold_left (fun x y -> self#collision y; ()) () balls 
	end

class blocks (blocks : block list) (right : int) (up : int) (nb_block : int) =
	object (self)
		val mutable b = blocks
		val r = right
		val u = up
		val nb = nb_block
		method private add (block : block) = b <- block::b
		method private random_block = new block (Random.int nb * r / nb) (u-10) 10 (r / nb) r u 1 black
		method get = b
		method spawn_block (x : int) (blocks_spawn : int list) = if List.mem x blocks_spawn then self#add self#random_block else ()
		method move = List.iter (fun b -> b#move) b
		method draw = List.iter (fun x -> x#draw) b
		method filter_exploded = b <- List.filter (fun x -> x#is_alive) b
		method filter_out = b <- List.filter (fun x -> not x#out_of_bounce) b
	end

class balls (ball : ball list) (right : int) (up : int) =
	object (self)
		val mutable b = ball
		val r = right
		val u = up
		method private add (ball : ball) = b <- ball::b
		method private blocks_and_ball (blocks : block list) (ball : ball) = List.fold_left (fun x y -> x#collision y; x) ball blocks
		method get = b
		method private fire_now x1 y1 bonus to_up color = match bonus with
											First -> self#add (new ball x1 y1 10 10 r u 1 color Center to_up)		
											|Second -> self#add (new ball x1 y1 10 10 r u 1 color Sin to_up); self#add (new ball x1 y1 10 10 r u 1 color Cos to_up)
											|Third -> self#add (new ball x1 y1 10 10 r u 1 color Center to_up); self#add (new ball x1 y1 10 10 r u 1 color Right to_up); self#add (new ball x1 y1 10 10 r u 1 color Left to_up)
											|Fourth -> self#add (new ball x1 y1 10 10 r u 1 color VeryLeft to_up); self#add (new ball x1 y1 10 10 r u 1 color Left to_up); self#add (new ball x1 y1 10 10 r u 1 color Center to_up); self#add (new ball x1 y1 10 10 r u 1 color Right to_up); self#add (new ball x1 y1 10 10 r u 1 color VeryRight to_up)
											|Fifth -> self#add (new ball x1 y1 10 10 r u 1 color SinLeft to_up); self#add (new ball x1 y1 10 10 r u 1 color CosLeft to_up); self#add (new ball x1 y1 10 10 r u 1 color Cos to_up); self#add (new ball x1 y1 10 10 r u 1 color Sin to_up); self#add (new ball x1 y1 10 10 r u 1 color CosRight to_up); self#add (new ball x1 y1 10 10 r u 1 color SinRight to_up)
											|Sixth -> self#add (new ball x1 y1 20 10 r u 2 color Sin to_up); self#add (new ball x1 y1 20 10 r u 2 color Cos to_up)
											|Seventh -> self#add (new ball x1 y1 20 10 r u 2 color Center to_up); self#add (new ball x1 y1 20 10 r u 2 color Right to_up); self#add (new ball x1 y1 20 10 r u 2 color Left to_up)
											|Eighth -> self#add (new ball x1 y1 20 10 r u 2 color VeryLeft to_up); self#add (new ball x1 y1 20 10 r u 2 color Left to_up); self#add (new ball x1 y1 20 10 r u 2 color Center to_up); self#add (new ball x1 y1 20 10 r u 2 color Right to_up); self#add (new ball x1 y1 20 10 r u 2 color VeryRight to_up)
											|Nineth -> self#add (new ball x1 y1 20 10 r u 2 color SinLeft to_up); self#add (new ball x1 y1 20 10 r u 2 color CosLeft to_up); self#add (new ball x1 y1 20 10 r u 2 color Cos to_up); self#add (new ball x1 y1 20 10 r u 2 color Sin to_up); self#add (new ball x1 y1 20 10 r u 2 color CosRight to_up); self#add (new ball x1 y1 20 10 r u 2 color SinRight to_up)
		method fire x1 y1 bonus to_up color (cpt : int) (freq : int list) = if List.mem cpt freq then self#fire_now x1 y1 bonus to_up color else ()
		method move = List.iter (fun b -> b#move) b
		method collision (blocks : block list) = b <- List.map (fun x -> self#blocks_and_ball blocks x) b 
		method draw = List.iter (fun x -> x#draw) b
		method filter_exploded = b <- List.filter (fun x -> x#is_alive) b
		method filter_out = b <- List.filter (fun x -> not x#out_of_bounce) b
	end

