		method private wait (t1 : float) = let rec aux t1 =
												let t2 = Sys.time () in
												if (t2 -. t1 > (1. /. fps)) then synchronize()
												else aux t1 
											in aux t1
		method private compt_fire (x : int) = if x = 10 then 0 else x + 1
		method private create_image (image_list : color list list) = make_image (Array.of_list (List.map (fun b -> Array.of_list b) image_list))
		method private create_boss (num : int) = match num with
												1 -> new boss (r / 2) (u * 3 / 4) (List.length lepen) (List.length (List.nth lepen 0)) r u (num * 150) black (self#create_image lepen) Third
												|3 -> new boss (r / 2) (u * 3 / 4) (List.length trump) (List.length (List.nth trump 0)) r u (num * 150) black (self#create_image trump) Fifth
												|5 -> new boss (r / 2) (u * 3 / 4) (List.length hitler) (List.length (List.nth hitler 0)) r u (num * 150) black (self#create_image hitler) Seventh
												|_ -> new boss (r / 2) (u * 3 / 4) (List.length kim) (List.length (List.nth kim 0)) r u (num * 150) black (self#create_image kim) Nineth
		method private create_blocks_spawning_freq (num : int) = match num with
																0 -> [5;10]
																|2 -> [0;4;7;10]
																|4 -> [0;2;4;6;9]
																|_ -> [0;2;4;6;8;10]
		method private game_level (blocks : blocks) (score_max : int) (blocks_spawn : int list) = let rec aux bl cpt score score_max blocks_spawn =
													let t = Sys.time () in
													ba#move;
													bl#move;
													s#move;
													bo#move;

													bo#spawn_bonus;
													bl#spawn_block cpt blocks_spawn;

													self#draw_background;
													ba#draw;
													bl#draw;
													s#draw;
													bo#draw;
													self#draw_score score score_max;
													s#draw_live;

													self#wait t;
													clear_graph ();

													let s1 = List.length blocks#get in

													s#collision_list bl#get;
													s#collision_list bo#get;
													ba#collision bl#get;

													ba#filter_exploded;
													bl#filter_exploded;
													bo#filter_exploded;

													let s2 = List.length blocks#get in

													ba#filter_out;
													bl#filter_out;
													bo#filter_out;

													let event = wait_next_event [Button_up; Poll] in
													match (event.button, score, s#is_alive) with
													(_,_,false) -> false
													|(_,sc,_) when sc > score_max -> true
													|(true,_,_) -> ba#fire s#x s#y s#b true red cpt s#f; aux bl (self#compt_fire cpt) (score + s1 - s2) score_max blocks_spawn
													|_ -> aux bl (self#compt_fire cpt) (score + s1 - s2) score_max blocks_spawn
												in aux blocks 0 0 score_max blocks_spawn
		method private game_boss (boss : boss) (boss_balls : balls) = let rec aux boss boss_balls cpt =
													let t = Sys.time () in
													ba#move;
													boss_balls#move;
													s#move;
													boss#move;
													bo#move;

													bo#spawn_bonus;
													boss_balls#fire (boss#x + boss#w / 2) boss#y boss#b false black cpt [5;10];

													self#draw_background;
													ba#draw;
													s#draw;
													bo#draw;
													boss#draw;
													boss_balls#draw;
													s#draw_live;
													boss#draw_lives;

													self#wait t;
													clear_graph ();

													s#collision_list boss_balls#get;
													s#collision_list bo#get;
													boss#collision_balls ba#get;

													boss_balls#filter_exploded;
													ba#filter_exploded;
													bo#filter_exploded;

													boss_balls#filter_out;
													ba#filter_out;
													bo#filter_out;

													let event = wait_next_event [Button_up; Poll] in
													match (event.button, boss#is_alive , s#is_alive) with
													(_,_,false) -> false
													|(_,boss_alive,_) when not boss_alive -> true
													|(true,_,_) -> ba#fire s#x s#y s#b true red cpt s#f; aux boss boss_balls (self#compt_fire cpt)
													|_ -> aux boss boss_balls (self#compt_fire cpt)
												in aux boss boss_balls 0
		method private give_level (num : int) = match num with
												num when num mod 2 = 0 -> self#game_level (new blocks [] r u (10 * (num + 1) / 2)) ((num + 1) * 100) (self#create_blocks_spawning_freq num)
												|_ -> self#game_boss (self#create_boss num) (new balls [] r u)
		method play = let rec aux (num : int) (fst_time : bool) = let win = self#give_level num in match (num, win) with
						(7,true) -> self#opening (not win) false; s <- new ship s#x s#y s#h s#w r u 10 blue First [10]; ba <- new balls [] r u; bo <- new bonus_list [] r u; ()
						|(_,true) ->  aux (num + 1) false
						|_ -> self#opening (not win) false; s <- new ship s#x s#y s#h s#w r u 10 blue First [10]; ba <- new balls [] r u; bo <- new bonus_list [] r u; aux 0 false
					in aux 0 true
		initializer self#init; self#opening true true
	end

let rec continue_without_quit (x : game) = x#play; continue_without_quit x

let () =
	Printf.printf "Enter Window's Width (Good ~500) = ";
	let r = read_int () in
	if r < 0 then failwith "Cannot be Negative";
	Printf.printf "Enter Window's Height (Good ~700) = ";
	let u = read_int () in
	if u < 0 then failwith "Cannot be Negative";
	Random.init 1234;
	let s = new ship 50 0 10 10 r u 10 blue First [10] in
	let ba = new balls [] r u in
	let bo = new bonus_list [] r u in
	let x = new game r u s ba bo in
	continue_without_quit x
